import React, { Fragment } from "react";
import { Grid, Button } from "@material-ui/core";
import { Link } from "react-router-dom";

const AboutUsSectionText = (props) => {
  return (
    <Fragment>
      <Grid item sm={6}>
        <h4 className="aboutUsSectionTitle">{props.longTitle}</h4>
        <p className="aboutUsSectionShortEx pt-5 pb-6">{props.longDesc}</p>
        <Button
          variant="contained"
          className="aboutUsSectionButton1 ml-4 "
          component={Link}
          to={props.btnPrimaryLink}
        >
          {props.btnPrimaryText}
        </Button>
        <Button
          variant="outlined"
          className="aboutUsSectionButton2"
          component={Link}
          to={props.btnSecondryLink}
        >
          {props.btnSecondryText}
        </Button>
      </Grid>
    </Fragment>
  );
};

export default AboutUsSectionText;
